import React, { useState } from 'react';
import './registro.css';

const Formulario = () => {
  const [visible, setVisible] = useState(true);

  const handleToggleForm = () => {
    setVisible(!visible);
  };

  return (
    <div>
      {visible ? (
        <form className="formulario">
          <div className="contenedor">
            <h1>Registrate</h1>
            <div className="input-contenedor">
              <i className="fas fa-user icon"></i>
              <input type="text" id="nombreCompleto" placeholder="Nombre Completo" />
            </div>
            <div className="input-contenedor">
              <i className="fas fa-envelope icon"></i>
              <input type="text" id="correoElectronico" placeholder="Correo Electrónico" />
            </div>
            <div className="input-contenedor">
              <i className="fas fa-key icon"></i>
              <input type="password" id="contrasena" placeholder="Contraseña" />
            </div>
            <h4>Generos favoritos</h4>
            <div className="form-check form-check-inline">
              <input className="form-check-input" type="checkbox" id="inlineCheckbox1" value="Comedia" />
              <label className="form-check-label" htmlFor="inlineCheckbox1">Comedia</label>
            </div>
            {/* ...Otras casillas de verificación... */}
            <input type="submit" value="Registrate" className="button" />
            <p>Al Registrarte, aceptas nuestras Condiciones de uso y Políticas de privacidad.</p>
          </div>
        </form>
      ) : (
        <button className="btn-cerrar" onClick={handleToggleForm}>
          <i className="fas fa-times"></i>
        </button>
      )}
    </div>
  );
};

export default Formulario;
